import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View } from 'react-native';
import Header from "./components/Header";
import Input from "./components/Input";
import {useState} from "react";
import Button from "./components/Button";
import BottomSheetComponent from "./components/BottomSheet"

export default function App() {
  const [nameIdentifier, setNameIdentifier] = useState("")
  const [numberIdentifier, setNumberIdentifier] = useState("")

  return (
    <View>
      <StatusBar style="inverted" />
      <Header title="Идентификатор"/>
      <View style={styles.container}>
        <Input
            placeholder='Название'
            style={styles.input}
            value={nameIdentifier}
            onChange={(e) => setNameIdentifier(e)}
        />
        <Input
            placeholder='Номер'
            style={styles.input}
            value={numberIdentifier}
            onChange={(e) => setNumberIdentifier(e)}
        />
        <Button style={styles.button}>Сохранить</Button>
        <BottomSheetComponent/>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    marginHorizontal: 16,
  },
    input: {
        marginTop: 16
    },
  button: {
    marginTop: 13
  }
});
